import { useEffect } from "react";
import { useState } from "react";
import * as tt from "@tomtom-international/web-sdk-maps";

function App() {

  const [map, setMap] = useState({})

  useEffect(() => {
    let map = tt.map({
      key: process.env.REACT_APP_TOMTOM_API_KEY,
      container: "map",
    })
    setMap(map)
  } , [])

  return (
    <div className="App">

    </div>
  );
}

export default App;
